import React from "react";
import { useParams, Link, Outlet, useLocation } from "react-router-dom";

function Sucess() {

  const params = useParams();
  const user = params.movie;
   const location = useLocation();

   const cost = location.state.totalcost;
   const count = location.state.counts;
   const theater=location.state.theatre;
   const time= location.state.time;
   var num=cost/count;
  return (
    <>
      <table>
        <tr>
          <td>Movie Name</td>
          <td>{user}</td>
        </tr>
        <tr>
          <td>No. of tickets</td>
          <td>{count}</td>
        </tr>
        <tr>
          <td>Cost of each ticket</td>
          <td>{num}</td>
        </tr>
        <tr>
          <td>Total Cost</td>
          <td>{cost}</td>
        </tr>
        <tr>
          <td>Theater</td>
          <td>{theater}</td>
        </tr>
        
        <tr>
          <td>Booking Status</td>
          <td>Confirmed</td>
        </tr>
      </table>

      <div class="success-feedback">
        <Link to="/city">
          <button class="btn btn-primary w-10 py-2">Home</button>
        </Link>

        <Link to="feedback">
          <button class="btn btn-primary w-10 py-2">Feedback</button>
        </Link>
      </div>
      <Outlet />
    </>
  );
}
export default Sucess;
